$(function() {

    var windowScrollTop;
    var windowHeight;
    var footerOffsetTop;

	$(window).on('load scroll', function () {
        windowScrollTop = $(this).scrollTop();
        windowHeight = $(this).outerHeight();
        footerOffsetTop = $('.footer').offset().top;
       if(windowScrollTop > 0){
           $('.header').addClass('fixed');
       } else{
           $('.header').removeClass('fixed');
       }

       if((footerOffsetTop - windowScrollTop - windowHeight) < 0){
           $('.callback').addClass('stuck');
       }else{
           $('.callback').removeClass('stuck');
       }
    }).on('load resize', function () {
        if (window.matchMedia('(max-width: 767px)').matches) {
            $('.reviews-list, .video-list').addClass('owl-carousel slider-dots').owlCarousel({
                items: 1,
                margin: 32
            })
        } else {
            $('.reviews-list, .video-list').removeClass('owl-carousel slider-dots').owlCarousel('destroy');
        }
    });

	$('.advantages .advantages-item').on('mouseenter', function () {
       $(this).addClass('open').find('.advantages-item-text').slideDown('fast');
    }).on('mouseleave', function () {
       $(this).removeClass('open').find('.advantages-item-text').slideUp('fast');
    });

	$('.reviews-item').on('mouseenter', function () {
       $(this).addClass('open').find('.reviews-item-img-big').slideDown('fast');
    }).on('mouseleave', function () {
       $(this).removeClass('open').find('.reviews-item-img-big').slideUp('fast');
    });

    // if($('.triangle').length){
    //     gsap.registerPlugin(MotionPathPlugin);
    //     const tween = gsap.timeline();
    //     tween.to(".triangle-img", {
    //         duration: 1,
    //         ease: "power1.inOut",
    //         motionPath: {
    //             path: [
    //                 {x: -1000, y: 2000}, {x: -window.outerWidth + 200, y: 6000}
    //             ],
    //             curviness: .8,
    //             autoRotate: true
    //         }
    //     });
    //     const controller = new ScrollMagic.Controller();
    //     const scene = new ScrollMagic.Scene({
    //         triggerElement: '.triangle',
    //         duration: 8000,
    //         triggerHook: 1
    //     }).setTween(tween).addTo(controller);
    // }

    $('.slider-nav').owlCarousel({
        items: 1,
        nav: true,
        touchDrag: false,
        mouseDrag: false,
        margin: 32,
        autoHeight: true
    });

	$('.slider-full').owlCarousel({
        items: 1,
        nav: true
    });

	$('.video-item-cover').on('click', function () {
       $(this).addClass('open');
    });

	$('.slider-nav .owl-dot').each(function () {
       $(this).text($(this).index() + 1);
    });

    $(".comparison").twentytwenty({
        no_overlay: true
    });

    $('.articles-item-desc').each(function () {
       var articleDesc = $(this).text();
       var articleCut = articleDesc.substring(0, 159);
       $(this).text(articleCut + '...');
    });

    $('.accordion-item-title').on('click', function () {
       $(this).siblings('.accordion-item-cont').slideToggle('fast').closest('.accordion-item').toggleClass('open').siblings('.accordion-item').removeClass('open').find('.accordion-item-cont').slideUp('fast')
    });

    $('select').customSelect();

    $('.content-page ol li').each(function () {
       var liIndex = $(this).index() + 1;
       $(this).prepend('<span>'+liIndex+'</span>');
    });

    $('.slider-double').closest('.content-page-wrap').addClass('with-slider');

    $('.slider-double .item').each(function () {
        var itemIndex = $(this).index();
        $(this).attr('data-id', itemIndex);
    });

    var sliderMain = $('.slider-double-main');
    sliderMain.each(function () {
        $(this).clone().removeClass('slider-double-main').addClass('slider-double-nav').insertAfter($(this));
        $(this).addClass('slider-nav').owlCarousel({
            items: 1,
            dots: true,
            smartSpeed: 100,
            responsive:{
                0:{
                    mouseDrag: true,
                    touchDrag: true
                },
                767:{
                    mouseDrag: false,
                    touchDrag: false
                }
            }
        });
        $(this).find('.owl-dot').each(function(){
            $(this).attr('data-id', $(this).index());
        });
    });

    var sliderNav = $('.slider-double-nav');
    sliderNav.owlCarousel({
        items: 4,
        dots: false,
        nav: true,
        mouseDrag: false,
        touchDrag: false
    });

    $('.slider-double .owl-item').each(function () {
        var itemIndex = $(this).find('.item').attr('data-id');
        $(this).attr('data-id', itemIndex);
    });

    sliderNav.each(function () {
        $(this).find('.owl-item:first-child').addClass('slide-current');
        $(this).find('.owl-item').on('click', function () {
            $(this).addClass('slide-current').siblings().removeClass('slide-current');
            var slideActive = $(this).attr('data-id');
            sliderMain.find('.owl-dot[data-id="' + slideActive +'"]').trigger('click');
        })
    }).on('translated.owl.carousel', function() {
        var slideActive = $(this).find('.owl-item.slide-current').attr('data-id');
        sliderMain.trigger('to.owl.carousel', [slideActive, 100]);
    });

    $('.slider-two').owlCarousel({
        items: 2,
        margin: 30
    });

    $('.valuation-category-button').on('click', function () {
        $('.top').addClass('with-calc');
        $('.calc').addClass('open');
        var target = $(this).attr('data-target');
        $('.calc-block[data-id='+target+']').addClass('active').siblings().removeClass('active');
    });

    $('.calc-block').each(function () {
        var screenLength = $(this).find('.calc-screen').length;
        $(this).find('.calc-progress span').css('width', 100/screenLength + '%');
    });

    $('.calc-back').on('click', function () {
        $('.calc-nav').removeClass('last');
        if($(this).closest('.calc-block').find('.calc-screen.active').is(':first-child')){
            $('.top').removeClass('with-calc');
            $('.calc').removeClass('open');
        }else{
            $(this).closest('.calc-block').find('.calc-screen.active').removeClass('active').prev().addClass('active');
        }
    });

    $('.calc-forward').on('click', function () {
        if(!$(this).closest('.calc-block').find('.calc-screen.active').is(':last-child')){
            $(this).closest('.calc-block').find('.calc-screen.active').removeClass('active').next().addClass('active');
        }
        if($(this).closest('.calc-block').find('.calc-screen.active').is(':last-child')){
            $('.calc-nav').addClass('last');
        }
    });

    $('.calc-nav-button').on('click', function () {
        var currentScreenLength = $(this).closest('.calc-block').find('.calc-screen').length;
        var currentScreenIndex = $(this).closest('.calc-block').find('.calc-screen.active').index() + 1;
        $(this).closest('.calc-block').find('.calc-progress span').css('width', 100/currentScreenLength*currentScreenIndex + '%');
    });

    $('.range-1').wRunner({
        step: 1,
        type: "single",
        limits: {
            minLimit: 20,
            maxLimit: 200
        },
        singleValue: 20,
        roots: document.body,
        valueNoteDisplay: true

    });

    $('.range-2').wRunner({
        step: 1,
        type: "single",
        limits: {
            minLimit: 1,
            maxLimit: 10
        },
        singleValue: 1,
        roots: document.body,
        valueNoteDisplay: true

    });

    $('.range-3').wRunner({
        step: 1,
        type: "single",
        limits: {
            minLimit: 1900,
            maxLimit: 2020
        },
        singleValue: 1900,
        roots: document.body,
        valueNoteDisplay: true

    });

    $('.range-4').wRunner({
        step: 1,
        type: "single",
        limits: {
            minLimit: 20,
            maxLimit: 700
        },
        singleValue: 20,
        roots: document.body,
        valueNoteDisplay: true

    });

    $('.range-5').wRunner({
        step: 1,
        type: "single",
        limits: {
            minLimit: 20,
            maxLimit: 1000
        },
        singleValue: 20,
        roots: document.body,
        valueNoteDisplay: true

    });

    $('.range-6').wRunner({
        step: 1,
        type: "single",
        limits: {
            minLimit: 250,
            maxLimit: 2500
        },
        singleValue: 250,
        roots: document.body,
        valueNoteDisplay: true

    });

    $('.header-toggle').on('click', function () {
       $('.header').toggleClass('open');
    });

});